public T next() {
 if(!this.hasNext())
   throw new NoSuchElementException();
  try {
    return service.take().get();
  } catch (InterruptedException e) {
    throw new ThreadInterruptedException(e);
  } catch (ExecutionException e) {
    throw new RuntimeException(e);
  } finally {
    --numTasks;
  }
}

